import React from "react";
import { Button } from "react-bootstrap";

const Info: React.FC = () => {
    return(
        <div className="text-center">
            <br />
            <h1> Informações do produto </h1>
            <br />
            <Button variant="success" type="submit"active>
                    Enviar
            </Button>
        </div>
        
    );
}

export default Info;
